description:
Wonderfully funny movie with Danny Kaye and other great character actors of the time. When growing up I would fake being sick to stay home and watch this.

Danny Kaye is the simpleton in a traveling snake oil show.  He is arrested as a vagrant in a town that is run on nepotism at its funniest, and then mistaken for the inspector general.  You will laugh all the way through.

